// Complete the countTriplets function below.
function countTriplets(arr, r) {
  debugger

  let max = -Infinity;
  let map = arr.reduce(function(map, val) {
      if(!map[val]) map[val] = 1;
      else map[val]++;
      max = Math.max(max, val);
      return map;
  }, {});

  let leftMap = {};

  let count = 0;
  for(let i = 0; i < arr.length; i++) {
    map[arr[i]]--;
    if(leftMap[arr[i]/r] && map[arr[i]*r]) { //left side exists 1 th of tripet
      count += leftMap[arr[i]/r]*map[arr[i]*r];
    }

    if(leftMap[arr[i]]) leftMap[arr[i]]++;
    else leftMap[arr[i]] = 1;
  }

  return count;
}

